script: |
  super -f tsv -I q10409.sql | sort > q10409.out

inputs:
  - name: q10409.sql
    data: |
      SELECT ALL + - col1 * CAST ( col0 AS INTEGER ) + - + 64 AS col2 FROM tab1 AS cor0 WHERE NULL NOT IN ( col0 + - - 3, - col1, + col0 + col1 + + - col2 * + col1 * col2, 67 / 95 / - col2 + 88 - + col1 );
  - name: tab1

outputs:
  - name: q10409.out
    data: |
